import styled from 'styled-components';

const ProductsSidebarStyles = styled.div`
  display: grid;
  grid-column: 1;
  background-color: lightgray;
  height: 100%;
  div {
    padding: 10px;
  }
`;

export default function ProductsSidebar() {
  return (
    <ProductsSidebarStyles>
      <div>
        Sidebar
      </div>
    </ProductsSidebarStyles>
  );
}
